import Display from './component/Display';
import './App.css';

function App() {
  // { "id": 101, "name": "Basket Ball", "image": "basketball.png", "price": 150 }, { "id": 102, "name": "Football", "image": "football.png", "price": 120 }, { "id": 103, "name": "Soccer", "image": "soccer.png", "price": 110 }, { "id": 104, "name": "Table Tennis", "image": "table-tennis.png", "price": 130 }, { "id": 105, "name": "Tennis", "image": "tennis.png", "price": 100 }
  return (
    <div className="App">
      <header className="App-header">
        <Display />
      </header>
    </div>
  );
}

export default App;
